!(function () {
  try {
    var e =
      0 ===
      (window.location && window.location.pathname ? window.location.pathname : '').indexOf(
        '/webpage/'
      )
        ? '/webpage'
        : '';
    if (!e) return;
    for (var t = document.querySelectorAll('a[href^="/"]'), r = 0; r < t.length; r++) {
      var a = t[r],
        n = a.getAttribute('href');
      n &&
        ('/' === n
          ? a.setAttribute('href', e + '/')
          : 0 === n.indexOf('/pages/') && a.setAttribute('href', e + n));
    }
  } catch {}
})();
